	private String MD5Hash(int IndexID) {
		if (this.Stored(IndexID)) {
			datItem II = this.ItemIndex.get(IndexID);
			ByteBuffer data = this.Read(II.DataOffset, II.DataSize);
			byte[] bytes = new byte[II.DataSize];
			data.get(bytes);

			byte[] MD5 = null;
			try { MD5 = MessageDigest.getInstance("MD5").digest(bytes); } catch (NoSuchAlgorithmException e) { }
			Formatter fmt = new Formatter();    
			for (byte b : MD5) {fmt.format("%02X", b);}
			return fmt.toString();
		}
		return "";
	}
	
